import React, {Component} from 'react';
import { Spring, config } from 'react-spring/renderprops';

class Executive extends Component{



  render(){
    return(
      <Spring
        config={{ mass: 30, tension: 200, friction: 280}}
        from={{opacity: 0}}
        to={{opacity: 1}}
      >

        { props => (
          <div style={props}>
            <div>
              <div className='Headings'>
              <hr />
              <h2> Executive Summary </h2>
              <hr />
              </div>

              <p> Line & Curve (L&C) is a Bangalore based design studio. L&C focusses on building and developing digital identities  for start-ups as well as established companies.</p>
              <p> L&C will operate out of a small office in Indira Nagar, Bangalore. For the first 3 months, our 5 man crew will be  managing all client needs. As our revenue targets are met, by month 4 we will begin to expand our team and scale up our operations to cater to a larger volume of clients.</p>
              <p> All members of our core-team have an extensive background in music and arts, bringing a fresh perspective to corporations. Our coding team comprises of hard-working hackers who have developed thousands of lines of beautiful code and have a strong passion for secure code and setting high standards. Additionally, we are well connected within the start-up network in Bangalore and are just one phone call away from professionals with various backgrounds who can provide invaluable advisory services.</p>
              <p> L&C will grow their customer base by providing clients well-priced, customized solutions.</p>
              <p> We at L&C love to learn. With every project we will develop our powers and improve the services we provide. By the end of our first short-time cycle of operations, we will develop into one of the leading design studio's in the country, ready to take on the world!</p>
              <hr />
            </div>
          </div>
        )}
      </Spring>
    );
  }
}

export default Executive;
